import { ReactComponent as Books } from "../../assets/expence-item-icons/taxi.svg";

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div className="expense-item--left-items">
        <Books className="expense-item--icon"/>
        <div className="expense-item--text">
          <h3 className="expense-text--title">title</h3>
          <p className="expense-text--data">data</p>
          <p className="expense-text--budget">budget</p>
        </div>
      </div>
      <div className="expense-item--right-items">
        <p className="expense-item--money">cena</p>
        <div className="expense-button">
          <p className="expense-button--edit">edit</p>
          <p className="expense-button--delate">usu≈Ñ</p>
        </div>
      </div>
    </div>
  );
}

export default ExpenseItem;
